import React from "react";
import Goal from "./Goal";
import "./GoalsList.css";

const GoalsList = (props) => {
  return (
    <div className="goalsList">
      {props.items.map((goal) => (
        <Goal />
      ))}
    </div>
  );
};

export default GoalsList;
